import React, {Component} from 'react'
import SignInForm from '../molecules/signinform'

export default class SignInArea extends Component {
    constructor (props) {
        super(props)
    }

    render () {
        return (
            <div className="Area">
                <h1>ログイン</h1>
                <SignInForm />
            </div>
        )
    }
}
